const Signup = () => {

    return (
        <div>
            title="Welcome Back"
            desc1="Build skills for today, tommorrow and beyond."
            desc2="Education to future-proof your career"
            image={loginImg}
            formType="login"
            setIsLoggedIn={setIsLoggedIn}
        </div>
    )
}

export default Signup;
